import React from 'react';
import { useTranslation } from 'react-i18next';

const Welcome: React.FC = () => {
  const { t } = useTranslation();
  const { i18n } = useTranslation();
  const lang = i18n.language || 'en';
  return (
    <div className="logo">
      {lang === 'hr' ? (
        // Croatian SVG inline
        <svg
          className="welcome"
          viewBox="0 0 612 792"
          xmlns="http://www.w3.org/2000/svg"
          aria-label={t('brand.logoAlt')}
          style={{ width: '100%', height: 'auto' }}
        >
          {/* ...dog and logo shapes... */}
          {/* --- BEGIN CROATIAN SVG CONTENT --- */}
          <ellipse cx="306.35" cy="396" rx="237.9" ry="240.49" style={{ fill: '#dbb69d' }} />
          {/* ...dog and other shapes from croatian.svg... */}
          {/* --- END CROATIAN SVG CONTENT --- */}
        </svg>
      ) : (
        // English SVG inline
        <svg
          className="welcome"
          viewBox="0 0 612 792"
          xmlns="http://www.w3.org/2000/svg"
          aria-label={t('brand.logoAlt')}
          style={{ width: '100%', height: 'auto' }}
        >
          {/* ...dog and logo shapes... */}
          {/* --- BEGIN ENGLISH SVG CONTENT --- */}
          <circle cx="306" cy="396" r="240.49" style={{ fill: '#dbb69d' }} />
          {/* ...dog and other shapes from english.svg... */}
          {/* --- END ENGLISH SVG CONTENT --- */}
        </svg>
      )}
    </div>
  );
};

export default Welcome;
